# 데이터 활용 함수들

def get_all_data():
    """전체 데이터 반환"""
    return population_data

def get_by_dong(dong_name):
    """특정 동의 데이터 검색"""
    return [row for row in population_data if dong_name in row['행정동_코드_명']]

def get_by_code(code):
    """행정동 코드로 검색"""
    return [row for row in population_data if row['행정동_코드'] == code]

def get_top_n(n=10):
    """유동인구 상위 N개 지역"""
    return sorted(population_data, key=lambda x: x['총_유동인구_수'], reverse=True)[:n]

def get_total_population():
    """전체 유동인구 합계"""
    return sum(row['총_유동인구_수'] for row in population_data)

def get_age_statistics():
    """연령대별 통계"""
    return {
        '10대': sum(row['연령대_10_유동인구_수'] for row in population_data),
        '20대': sum(row['연령대_20_유동인구_수'] for row in population_data),
        '30대': sum(row['연령대_30_유동인구_수'] for row in population_data)
    }

if __name__ == '__main__':
    print(f"총 데이터 수: {len(population_data)}")
    print(f"전체 유동인구: {get_total_population():,}명")
    print("\n[상위 10개 지역]")
    for i, row in enumerate(get_top_n(10), 1):
        print(f"{i}. {row['행정동_코드_명']}: {row['총_유동인구_수']:,}명")
